Storyline:


     Prior to the attack on Pearl Harbor, Dean Hess (Rock Hudson) was a minister in Ohio. The attack prompted him to become a fighter pilot. Hess accidentally dropped a bomb on an orphanage in Germany during World War II, killing 37 orphans. At the start of the Korean War, Hess volunteers to return to the cockpit and is assigned as the senior USAF adviser/Instructor Pilot to the Republic of Korea Air Force, flying F-51D Mustangs.




